import React from "react";
import Parallax from "react-rellax";

//COMPONENTS
import Line from "../2_module/Line";
import BackgroundImg from "./BackgroundImg";

//STYLES
import { HeaderStyle } from "../../2_styles/1_layout/HeaderStyle";

export default function Header({ bgImg, bgImgBlur, title, subtitle }) {
  return (
    <div>
      <HeaderStyle>
        <Parallax speed={1}>
          <BackgroundImg bgImg={bgImg} bgFixed="fixed" />
        </Parallax>

        <Parallax speed={-10}>
          <div className="title">
            <p>the</p>
            <p>{title}</p>
            <Line />
            <p>{subtitle}</p>
          </div>
        </Parallax>
      </HeaderStyle>
    </div>
  );
}
